from datetime import datetime


class Value:
    def __init__(self):
        self.val = 0

    def incr(self):
        self.val += 1


class Solution(object):
    def account(self, pos, x, value, cand, maxVal):
        if x == "0":
            cand[pos] = value
        elif x == "E":
            value.incr()
        else:
            maxVal = max(maxVal, value.val)
            value = Value()
        return value, maxVal

    def accountAll(self, grid):
        n, m = len(grid), len(grid[0])
        horCand, verCand = dict(), dict()
        horValue = [Value() for _ in xrange(n)]
        verValue = [Value() for _ in xrange(m + 1)]
        maxHor, maxVer = 0, 0
        for i in xrange(n):
            for j in xrange(m + 1):
                if j < m:
                    x = grid[i][j]
                else:
                    x = "W"
                pos = (i, j)
                horValue[i], maxHor = \
                    self.account(pos, x, horValue[i], horCand, maxHor)
                verValue[j], maxVer = \
                    self.account(pos, x, verValue[j], verCand, maxVer)
        return horCand, verCand, maxHor, maxVer

    def maxKilledEnemies(self, grid):
        """
        :type grid: List[List[str]]
        :rtype: int
        """
        if len(grid) == 0 or len(grid[0]) == 0:
            return 0
        zero = Value()
        start = datetime.now()
        horCand, verCand, maxHor, maxVer = self.accountAll(grid)
        end = datetime.now()
        print("accountAll took %s" % (end - start))
        val = lambda p: horCand.get(p, zero).val + \
                        verCand.get(p, zero).val
        commonCand = horCand.viewkeys() & verCand.viewkeys()
        if commonCand:
            return max(map(val, commonCand))
        else:
            if not horCand:
                maxHor = 0
            if not verCand:
                maxVer = 0
            return max(maxHor, maxVer)


